import { Link } from 'react-router-dom'

function CastCard(props) {
    const link = 'https://image.tmdb.org/t/p/w500'

    return (
        <Link to={'/actor/' + props.cast.id} className="actor-card">
            <div className="actor-card-top">
                <img className="actor-card-profile" src={link + props.cast.profile_path} alt="" />
            </div>
            <div className="actor-card-info">
                <h1 className="actor-card-name">{props.cast.name}</h1>
                <p className="actor-card-sphere">{`Trending For ${props.cast.known_for_department}`}</p>
            </div>
        </Link>
    )
}

export default CastCard;
